 ((coalesce(count(Previous_Promoters)/count(Previous),0)) - (coalesce(count(Previous_Detractors)/count(Previous),0))))/
 ((coalesce(count(Previous_Promoters)/count(Previous),0))- (coalesce(count(Previous_Detractors)/ count(Previous),0))) as 'PoP_Percent_Change';

